import React from 'react';
import './css/Photo.css';

const Photographs = () => {
  return (
    <div className="photographs-container">
      <div className="photograph-tile" onClick={() => window.location.href='/photographs'}>
        <img src="your-image-url" alt="Photograph 1" />
        <h2>Title 1</h2>
        <p>Description about Photograph 1 goes here...</p>
      </div>
      <div className="photograph-tile" onClick={() => window.location.href='/photographs'}>
        <img src="your-image-url" alt="Photograph 2" />
        <h2>Title 2</h2>
        <p>Description about Photograph 2 goes here...</p>
      </div>
      <div className="photograph-tile" onClick={() => window.location.href='/photographs'}>
        <img src="your-image-url" alt="Photograph 3" />
        <h2>Title 3</h2>
        <p>Description about Photograph 3 goes here...</p>
      </div>
      <button className="show-more" onClick={() => window.location.href='/photographs'}>
        Show More
      </button>
    </div>
  );
};

export default Photographs;
